First, let's factorize 450:
\[ 450 = 2 \times 3^2 \times 5^2 \]

For a number to have digits only 0s and 1s, it must be a product of powers of 2 and 5, since these are the only prime factors of 10, which is the base of the decimal system. However, the number must also include the factors of 3^2 from 450.

