original_question:
Trijstūris $ABC$ ir vienādsānu, ar $AB=AC$ un augstumu $AM=11.$ Pieņemsim, ka uz $\overline{AM}$ ir punkts $D$ ar $AD=10$ un $\angle BDC=3\angle BAC.$  Atrodiet trijstūra $ABC$ perimetru.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

